import React from 'react';
import AllCards from './AllCards';
import './card-master.scss';



export default class CardMaster extends React.Component {
  constructor(props) {
    super(props) 
    this.cardName = props.cardName
  } 

  render() {
    return (
      <div className='card__master'>
          <h2 className="card__master--heading">{this.cardName}</h2>

      </div>
    )
  }
}
